// SPRITES
var sprites = {
	left: {
		thrust: 'data:image/png;base64,',
		no_thrust: 'data:image/png;base64,'
	},
	right: {
		thrust: 'data:image/png;base64,',
		no_thrust: 'data:image/png;base64,'
	}
};
var magnet_img = 'data:image/png;base64,';
var explode_img = 'data:image/png;base64,';

// GAME AREAS
var safe_zone = 100;
var target_distance = 5535;
var magnet_size = 300;
var total_distance = target_distance + magnet_size;

// FORMULAS
var fuel_formula = function(acceleration){
  return Math.pow(acceleration, 2) / 1000;
};

// DCPU MEMORY LOCATIONS
var accelerator = 0x1000;
var speedometer = 0x1001;
var distance_meter = 0x1002;
var fuel_meter = 0x1003;

// DOM SETUP
var meters = hud.appendChild(Adventure.createDOMTree(
	'<table>'
	+ '<tr><td>Speed:</td><td id="speed"></td></tr>'
	+ '<tr><td>Distance:</td><td id="distance"></td></tr>'
	+ '<tr><td>Time:</td><td id="time"></td></tr>'
	+ '<tr><td>Fuel:</td><td id="fuel"></td></tr>'
	+ '</table>'
));
var speed_output = meters.getElementById('speed');
var distance_output = meters.getElementById('distance');
var time_output = meters.getElementById('time');
var fuel_output = meters.getElementById('fuel');
var graphics = hud.appendChild(Adventure.createDOMTree(
	'<div style="position: relative">'
	+ '<img id="rocket" style="position: absolute; width: 10%; top: 2em;" />'
	+ '<img id="magnet" style="position: absolute; top: 2em; right: 0" />'
	+ '</div>'
));
var magnet = graphics.getElementById('magnet');
magnet.src = magnet_img;
magnet.style.width = (100 * (total_distance - target_distance) / total_distance) + '%';
var rocket = graphics.getElementById('rocket');
rocket.src = sprites.right.no_thrust;

// GAME STATE
var speed = 0;              // units per second
var x = 0x100;              // rocket's position
var facing = sprites.right; // face the direction of acceleration
var start = null;           // the clock starts when acceleration begins
var fuel = 5000;            // units of fuel

// TEST STUFF
//fuel = 0;
//fuel = 100;
//x = 62450;
//x = 65500;

// GAME GO!!!
var runner = setInterval(function(){
  if (fuel){
    var acceleration = dcpu.get(accelerator);
    if (! start && acceleration)
      start = new Date();
    if (acceleration >= 0x8000)
      acceleration = -(0x10000 - acceleration);
    speed += acceleration / 10; // acceleration is in "units per second per second"
    speed = Math.round(speed * 10) / 10;
    if (speed > 0x7FFF)
      speed = 0x7FFF;
    if (speed < -0x7FFF)
      speed = -0x7FFF;
    fuel -= fuel_formula(acceleration);
    fuel = Math.round(fuel * 1000) / 1000;
    if (fuel < 0)
    	fuel = 0;
  }
  if (acceleration)
    facing = acceleration > 0 ? sprites.right : sprites.left;
  rocket.src = acceleration ? facing.thrust : facing.no_thrust;
  dcpu.set(speedometer, speed);
  speed_output.innerHTML = speed;
  fuel_output.innerHTML = fuel;
  var time = (start ? new Date().valueOf() - start.valueOf() : 0) / 1000;
  time_output.innerHTML = time + ' s';
  x += speed / 10;
  var distance = parseInt(target_distance - x) & 0xFFFF;
  dcpu.set(distance_meter, distance);
  dcpu.set(fuel_meter, fuel & 0xFFFF);
  distance_output.innerHTML = Math.round(distance);
  if (x > target_distance || x < 0){
  	rocket.src = explode_img;
  	speed_output.innerHTML = 'CRASH!!!';
  	distance_output.innerHTML = 'CRASH!!!';
  	fuel_output.innerHTML = 'CRASH!!!';
  	rocket.style.left = x < 0 ? '-5%' : '85%';
  	rocket.style.top = '0';
  	rocket.style.width = '20%';
  	clearInterval(runner);
  	return;
  }
  else{
  	rocket.style.left = 90 * (x / total_distance) + '%';
  }
  if (x > target_distance - safe_zone && speed == 0){
  	rocket.src = facing.no_thrust;
  	rocket.style.left = '';
  	rocket.src = sprites.left.no_thrust;
  	rocket.style.right = (40 * (total_distance - target_distance) / total_distance) + '%';;
  	var win = hud.appendChild(document.createElement('span'));
  	win.innerHTML = 'WIN!!!';
  	win.style.fontSize = '300%';
  	clearInterval(runner);
  	if (time)
  		submit_win(1/time, "Exercise completed in " + time + " seconds.");
  }
}, 100);
